        this.companyAddress = '';
        this.branchName = '';
        this.dateFrom = '';
        this.dateTo = '';
        this.siteCode = '';
        this.summaryList = [];
        this.detailList = [];
        this.whCode = '';
        this.whSelectionList = [];
        this.itemId = '';
        this.itemSelectionList = [];
        this.totAmount = 0;
        this.totDiscount = 0;
        this.totNetAmountBT = 0;
        this.totTaxAmount = 0;
        this.totSalesAmount = 0;
        this.totCost = 0;
        this.totGrossMargin = 0;
        this.totGrossMarginPer = 0;
        this.pageNumber = 0;
        this.pageSize = 1; //Items per page
        this.summaryPageSize = 50;
        this.detailedPageSize = 1;
        this.totalItemsCount = 0;
